def max_days_without_additional_food(a, b, c):
    Q = [a // 3, b // 2, c // 2]
    q = min(Q)
    R = [a - 3 * q, b - 2 * q, c - 2 * q]
    s = [0, 1, 2, 0, 2, 1, 0]
    s /= 2
    ans = -1
    for i in range(7):
        temp = R[:]
        for j in range(i, i + 7):
            if temp[s[j]] == 0:
                break
            else:
                temp[s[j]] -= 1
        ans = max(7 * q + j - i, ans)
    return ans

